import { Button, List } from 'antd';
import generate from 'shortid';
import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { follow, setUsers, unfollow } from '../../reducers/users';

const Users: React.FC = () => {
  const dispatch = useDispatch();
  const { users }: any = useSelector((state: any) => state.users);

  useEffect(() => {
    dispatch(
      setUsers([
        {
          id: generate(),
          photoUrl:
            'data:image/jpeg;base64,',
          followed: false,
          fullName: 'Mikhail',
          status: 'I am a boss',
          location: { city: 'Saint-Petersburg', country: 'Russia' },
        },
        {
          id: generate(),
          photoUrl:
            'data:image/jpeg;base64,',
          followed: true,
          fullName: 'Vova',
          status: 'I am a boss',
          location: { city: 'Saint-Petersburg', country: 'Russia' },
        },
        {
          id: generate(),
          photoUrl:
            'data:image/jpeg;base64,',
          followed: false,
          fullName: 'Sasha',
          status: 'I am a boss',
          location: { city: 'Krasnodar', country: 'Russia' },
        },
      ]),
    );
  }, [dispatch]);

  return (
    <List
      dataSource={users}
      renderItem={({ fullName, id, location, status, photoUrl, followed }: any) => (
        <List.Item key={id}>
          <div>
            <div>
              <img src={photoUrl} alt={fullName} />
            </div>
            <div>
              {followed ? (
                <Button onClick={() => dispatch(unfollow(id))}>Unfollow</Button>
              ) : (
                <Button onClick={() => dispatch(follow(id))}>Follow</Button>
              )}
            </div>
            <div>{fullName}</div>
            <div>{status}</div>
            <div>{location.city}</div>
          </div>
        </List.Item>
      )}
    />
  );
};

export default Users;
